import React from "react";
import s from "./LinkCard.module.scss";


function LinkCard({ image, title, direction, date, price, city }) {

    return (
          <>

          <div className={s.BpkCard}>
            {/* <div>{city}</div> */}
            <div className={s.BpkImage}>
              <img src={image} className={s.image} />
            </div>
            <div className={s.InternalLinkCard}>
              <div className={s.InternalLinkTitle}>{title}
              </div>
              <div className={s.directionTitle}>{direction}</div>
              <div>{date}</div>
              <div>{price}</div>
              <button>Select</button>
            </div>
            </div>

          </>
  );
}
export default LinkCard;
